function searchTable(e,s,t="",n="LIKE"){if("string"==typeof e){let c=document.getElementById(e),a=c.querySelector("tbody").rows;for(let e of a)switch(n){case"LIKE":e.querySelectorAll("td")[s].innerHTML.includes(t)?e.classList.contains("mustBeMask")||e.classList.remove("d-none"):e.classList.add("d-none");break;case"EQUAL":e.querySelectorAll("td")[s].innerHTML==t?e.classList.contains("mustBeMask")||e.classList.remove("d-none"):e.classList.add("d-none")}}}function searchArray(e,s,t="",n="LIKE"){let c=[];return"object"==typeof e&&e.length>0&&e.forEach(e=>{if(e[s])switch(n){case"LIKE":e[s].includes(t)&&c.push(e);break;case"EQUAL":e[s]==t&&c.push(e)}else c=[]}),c}